import PeopleIcon from '@mui/icons-material/People';
import ClassIcon from '@mui/icons-material/Class';
import CategoryIcon from '@mui/icons-material/Category';
import DiscountIcon from '@mui/icons-material/Discount';
import {Admin, Resource, ListGuesser, ShowGuesser} from 'react-admin';
import jsonServerProvider from 'ra-data-json-server';
import Dashboard from './dashboard';
import {render} from 'react-dom';
import React, {Component} from "react";
import userList from './adminUsers';

const theme = {
    palette: {
        mode: 'light', // Switching the dark mode on is a single property value change.
    },
  }
const dataProvider = jsonServerProvider("https://jsonplaceholder.typicode.com");

export default class Adminpanel extends Component{
    render(){
        return(
            <Admin theme={theme} dashboard={Dashboard} dataProvider={dataProvider} >
                <Resource name="users" list={ListGuesser} create={userList} icon={PeopleIcon} options={{ label: 'Add Users' }}  />
                <Resource name="albums" list={ListGuesser} icon={CategoryIcon} options={{ label: 'Add Branches' }} />
                <Resource name="todos" list={ListGuesser} icon={ClassIcon} options={{ label: 'Add Items & Categories' }} />
                <Resource name="posts" list={ListGuesser} icon={DiscountIcon} options={{ label: 'Add Promotions & Discounts' }} />
                <Resource name="photos" list={ListGuesser} icon={PeopleIcon} options={{ label: 'Add Areas Covered' }} />
            </Admin>
            
        );
    }
}
